//main.js加载所有资源(组件;js/css/..)创建vue实例对象
import Vue from 'vue'
import App from './App.vue'
//1.加载路由模块
import router from './router'
//1.1加载模块 VueResource
import VueResource from 'vue-resource'
//1.2将VueResource 注册vue
Vue.use(VueResource);
//1.3将Mintui加载项目
//1.4按需引入组件Header顶部固定导航栏
import {Header} from "mint-ui"
//1.5注册组件
Vue.component(Header.name,Header)
//1.6引入mui css
import "./lib/mui/css/mui.css"





//2.是否是生产模式false
Vue.config.productionTip = false
//3.创建vue实例对象挂载 public/index.html#app
new Vue({
  router,
  render: h => h(App)
}).$mount('#app')
